import React from 'react';
import { Container, Nav, Navbar, NavDropdown } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

function Top({userId,onLogout}) {
  console.log(userId);
  console.log(onLogout); // 함수의 원형을 그대로 출력됨
  const navigate = useNavigate();
  // const moveMain = (userId) => {
  //   console.log(userId);
  //   navigate({pathname: '/main/'+userId})
  // }
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">자바 캠프</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link onClick={()=>{navigate("/")}}>Home</Nav.Link>
            <Nav.Link href="#link">Link</Nav.Link>
            <NavDropdown title="로그인" id="basic-nav-dropdown">
              <NavDropdown.Item onClick={()=>{}}>Google</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">
                Separated link
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
          {onLogout && <Button></Button>}
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Top;
